const App = () => {
  return (
    <Grid container direction = "column">
      <Grid item>This is where the header will be</Grid>
      <Grid item container>
        <Grid xs={0} sm={2}/>
        <Grid sm={8} xs={12}>

        </Grid>
      </Grid>
    </Grid>
  );
}

export default App;
